import React, { Component } from 'react';
import '../Estilos/Home.css'
import Slide from '../componentes/carrusel/slide'
import Headerv2 from './componentes/inicio/headerv2';

class Home extends Component {
    render() {
        return (    
            <div className="container-fluid">
            <Headerv2 />
            <div class="container">    
            <div class="card">
            <div class="card-body">
                <h1 class="card-title" >¿Qué se te antoja hoy?</h1>
                <div class="vacio"></div>
                <p class="card-text"><strong>Más pedidos</strong></p>
                <Slide />
                <br></br>
                <p class="card-text"><strong>Categorias</strong></p>
            </div>
            </div>
            </div> 
            </div>

        )
    }
}

export default Home;
